import React, { Component } from "react";

export default class BasicButton extends Component {
  constructor(props) {
    super(props);
    this.state = {
      buttonName: props.buttonName,
      buttonType: props.buttonType,
    };
    this.setCanvasDrawingRef = React.createRef();
  }

  disableButtonWhenSetting() {
    this.props
  }

  render() {
    const { buttonName, buttonType } = this.state;
    return (
      <React.Fragment>
        <button type={buttonType} onClick={() =>
          this.props.onClick()
        }>
          {buttonName}
        </button>
      </React.Fragment>
    );
  }
}
